import axios from 'axios';

export const MAP_SET_MAP = 'MAP/SET_MAP';
export const MAP_SET_MAP_REF = 'MAP/SET_MAP_REF';
export const MAP_SET_MAP_CENTER = 'MAP/SET_MAP_CENTER';
export const MAP_LOADING_MAP = 'MAP/LOADING_MAP';
export const MAP_LOADING_MAP_SUCCESS = 'MAP/LOADING_MAP_SUCCESS';
export const MAP_LOADING_MAP_ERROR = 'MAP/LOADING_MAP_ERROR';

export const setMap = (map) => {
    return {
        type: MAP_SET_MAP,
        map
    }
};

export const setMapRef = (mapRef) => {
    return {
        type: MAP_SET_MAP_REF,
        mapRef
    }
};

export const setMapCenter = (latlng) => {
    return {
        type: MAP_SET_MAP_CENTER,
        latlng
    }
};

export const setMapLoading = (mapLoading) => {
    return {
        type: MAP_LOADING_MAP,
        mapLoading
    }
};

export const loadingSuccessMap = (map, mapRef, kakao) => {
    return {
        type: MAP_LOADING_MAP_SUCCESS,
        map,
        mapRef,
        kakao
    }
};

export const loadingErrorMap = () => {
    return {
        type: MAP_LOADING_MAP_ERROR
    }
};
